import './App.css';
import {BrowserRouter, Route, Routes} from 'react-router-dom';

import Room from './pages/Room';
import Home from './pages/Home';

function App() {
  return (
    <BrowserRouter>
      <div className="App">

        <h2> hello </h2>
        <Routes>
          <Route path="/" element={<Home />}/>
          <Route path="/room" element={<Room/>}/>
        </Routes>

      </div>
    </BrowserRouter>

  );
}

export default App;
